import React, { Component } from 'react'  

export class PageNotFound extends React.Component {  
    render() {  
        return (  
            <div>  
        <div class="container my-auto">  
          <div class="copyright text-center my-auto">  
            <span>Page Not Found</span>  
          </div>  
        </div>  
            </div>  
        )  
    }  
}  

export default PageNotFound;
